import React, { Component } from "react";
import { Col, Row } from "react-bootstrap";
import { Link } from "react-router-dom";
import "./Footer.css";
class Footer extends Component {
  render() {
    return (
      <div className="footer fixed-down">
        <Row>
          <Col md={4}>
            <h3
              style={{
                marginLeft: `10%`,
                fontSize: `40px`,
                fontWeight: `bolder`,
                fontStyle: `italic`,
                color: "white",
              }}
            >
              Blue
              <span style={{ color: `orange`, fontFamily: `sans-serif` }}>
                Let
              </span>
            </h3>
          </Col>

          <Col md={4}>
            <p className="paras">
              &copy; 2021 All Rights Reserved, Blue
              <span style={{ color: `orange`, fontFamily: `sans-serif` }}>
                Let
              </span>
              .
            </p>
          </Col>

          <Col md={4}>
            <p className="para">phone: +233572211378</p>
            <p className="para">
              email:<Link>antwi2k@gmail.com</Link>
            </p>
          </Col>
        </Row>
      </div>
    );
  }
}

export default Footer;
